('bg_BG', 15, 'Terms & Conditions', 'Copyrights and other intellectual property rights to all text, images, audio, software and other content on this site are owned by Resido and its affiliates. Users are allowed to view the contents of the website, cite the contents by printing, downloading the hard disk and distributing it to others for non-commercial purposes.', '<p style=\"text-align:justify;\"><span style=\"font-family:Arial, Helvetica, sans-serif;font-size:16px;\"><span>Access to and use of the Resido website is subject to the following terms, conditions, and relevant laws of Vietnam.</span></span><span style=\"font-size:16px;\"><span>&nbsp;</span></span></p><h4 style=\"text-align:justify;\"><span style=\"font-family:Arial, Helvetica, sans-serif;font-size:18px;\"><span><strong>1. Copyright</strong></span></span><span style=\"font-size:18px;\"><span>&nbsp;</span></span></h4><p style=\"text-align:justify;\"><span style=\"font-family:Arial, Helvetica, sans-serif;font-size:16px;\"><span>Copyrights and other intellectual property rights to all text, images, audio, software and other content on this site are owned by Resido and its affiliates. Users are allowed to view the contents of the website, cite the contents by printing, downloading the hard disk and distributing it to others for non-commercial purposes, providing information or personal purposes. Any content from this site may not be used for sale or distribution for profit, nor may it be edited or included in any other publication or website.</span></span><span style=\"font-size:16px;\"><span>&nbsp;</span></span></p><h4 style=\"text-align:justify;\"><span style=\"font-family:Arial, Helvetica, sans-serif;font-size:18px;\"><span><strong>2. Content</strong></span></span><span style=\"font-size:18px;\"><span>&nbsp;</span></span></h4><p style=\"text-align:justify;\"><span style=\"font-family:Arial, Helvetica, sans-serif;font-size:16px;\"><span>The information on this website is compiled with great confidence but